'use strict';
class OpenPositionManagerOnRefreshAction {
    listener;
    static create() {
        let result;
        result = new OpenPositionManagerOnRefreshAction();
        return result;
    }
    setListener(listener) {
        this.listener = listener;
    }
    execute() {
        this.listener.onRefresh();
    }
}
module.exports = OpenPositionManagerOnRefreshAction
